



CREATE OR REPLACE FUNCTION "public"."proc_get_rfq_idle_mass"(IN v_job_id int4, IN v_limit int4, IN v_offset int4, OUT o_idle_count int4, OUT o_fail_count int4, OUT o_ex_msg varchar)
  RETURNS "pg_catalog"."record" AS $BODY$declare
	v_idle_day_count int4;
	v_rc_part	record;
  v_cur_time_str varchar;
  v_cur_date_str varchar;
  v_last_date date;
  v_last_id int4;
  v_count int4;
  v_day_diff int4;
  v_message_text varchar;
  v_exception_detail varchar;
begin
	o_idle_count:=0;
	o_fail_count:=0;
	o_ex_msg:='';
  --查找参数信息
	select value into v_idle_day_count from iac_rfq_mass_variant t where t.key='IDLE_DAY_COUNT';
	if not found THEN
     o_ex_msg:='IDLE_DAY_COUNT param not defined';
     return;
  end if;
  --获取当前时间
  select to_char(now(),'YYYY-MM-DD HH24:MI:SS') INTO v_cur_time_str;
  --获取当前日期
  select to_char(now(),'YYYY-MM-DD') INTO v_cur_date_str;
  --根据分页参数获取材料列表
  for v_rc_part in select * from "public".material_master where id=5001 order by id limit v_limit offset v_offset
  loop
		BEGIN
				--判断特定材料是否久未异动
        --判断在阈值天数内是否有rfq记录

        select count(*) into v_count from "public".inforecord_history t where t.part_id=v_rc_part.id;
        if v_count=0 THEN
           continue;
        end if;

        --获取最近变更的时间
        select max(t.valid_from) into v_last_date from "public".inforecord_history t where t.part_id=v_rc_part.id;
        --获取最近变更的天数差
        select to_date(v_cur_date_str, 'YYYY-MM-DD')-v_last_date into v_day_diff;

       --排除天数小于阈值的情况
        if v_day_diff<v_idle_day_count THEN
           RAISE NOTICE 'v_day_diff is ( % ), v_idle_day_count is ( % )', v_day_diff,v_idle_day_count;
           continue;

        end if;

        --排除新材料的情况
        select count(*) into v_count from "public".inforecord_history t where t.part_id=v_rc_part.id and valid_from<v_last_date;
        if v_count=0 THEN
           RAISE NOTICE 'part is new material';
           continue;
        end if;

		    --获取久未异动的rfq his
        select max(id) into v_last_id from "public".inforecord_history t where t.part_id=v_rc_part.id and valid_from=v_last_date;
        --排除材料已经进入rfq_mass表中的正在处理的情况情况
        select count(*) into v_count from "public".iac_rfq_mass_line t where t.last_rfq_his_id=v_last_id and t.flag in ('C','Y','N')
        and t.state in ('draft','processing');
        if v_count>0 THEN
           RAISE NOTICE 'part is in processing';
           continue;
        end if;

        --处理久未异动的rfq,写入数据到rfq_mass表中
					plant_id,
					vendor_id,
					part_id,
					part_code,
					currency_id,
					rfq_price,
					valid_from,
					valid_to,
					price_control,
					lt,
					moq,
					mpq,
					rw,
					cw,
					tax,
					price_unit,
					job_id,
          last_rfq_his_id,
          flag,
          state,
          division_id,
          buyer_code_id,
          buyer_code,
          active
				) SELECT
					T .plant_id,
					T .vendor_id,
					T .part_id,
					T .part_no,
					T .currency_id,
					T .price,
					T .valid_from,
					T .valid_to,
					T .price_control,
					T .ltime,
					T .moq,
					T .mpq,
					T .rw,
					T .cw,
					T .taxcode,
					T .price_unit,
					v_job_id,
          v_last_id,
          'C',
          'draft',
          v_rc_part.division_id,
          v_rc_part.buyer_code_id,
          v_rc_part.buyer_code,
          true
				FROM
					inforecord_history T where t.id=v_last_id;
       o_idle_count:=o_idle_count+1;
			EXCEPTION
			when OTHERS THEN
           GET STACKED DIAGNOSTICS
                                   v_message_text = MESSAGE_TEXT,
																	 v_exception_detail=PG_EXCEPTION_DETAIL;
          /*
						job_id,
						plant_id,
						part_id,
            plant_code,
            part_code,
						ex_msg,
            last_rfq_his_id
					)
					values(v_job_id,v_rc_part.plant_id,v_rc_part.id,v_rc.plant_code,v_rc.part_no,v_exception_detail,v_last_id);
          */
						job_id,
						ex_msg,
            last_rfq_his_id
					)
					values(v_job_id,v_message_text,v_last_id);
          o_fail_count:=o_fail_count+1;
		end;
  end loop;

	return;


end;
$BODY$
  LANGUAGE 'plpgsql' VOLATILE COST 100
;

ALTER FUNCTION "public"."proc_get_rfq_idle_mass"(IN v_job_id int4, IN v_limit int4, IN v_offset int4, OUT o_idle_count int4, OUT o_fail_count int4, OUT o_ex_msg varchar) OWNER TO "openerp";